<script>

    function Guardar() {

        //document.getElementById(""idEspecialidad"").value = id;
        //codigo de pop up

        //Validar()

        Swal.fire({
            title: ""Desea agregar el registro?"",
            text: ""Desea agregar la informacion en la base de datos"",
            icon: 'warning',
            showCancelButton: true,
            confirmButtonColor: '#3085d6',
            cancelButtonColor: '#d33',
            confirmButtonText: 'Si!'
        }).then((result) => {
            if (result.value) {
                //enviar a base de datos
                var frmWeb = document.getElementById(""frmWeb"");
                frmWeb.submit();


                Swal.fire({
                    position: 'top-end',
                    icon: 'success',
                    title: 'Cambios guardados exitosamente!',
                    showConfirmButton: false,
                    timer: 1500
                })

            }
        })


    }
</script>");
